Stačiakampis $ABCD$ turi centrą $O$ ir $AB/AD=k$. Taškas atsitiktinai pasirenkamas iš stačiakampio $ABCD$ vidaus. Kokia tikimybė, kad jis bus arčiau $O$ nei bet kuris iš keturių viršūnių?  [asy]
size(200);
draw((-250,100)--(250,100)--(250,-100)--(-250,-100)--cycle);
dot((0,0));
label("$O$",(0,0),N);
label("$A$",(-250,100),NW); label("$B$",(250,100),NE); label("$C$",(250,-100),SE); label("$D$",(-250,-100),SW);[/asy]

